import React from 'react'
import s from "./MobileHome.module.css"

const MobileHome = (props) => {

    return (
        <div className={s.MobileHome}>
            <div></div>
            <div className={s.AboutOlimpiad}></div>
            <div className={s.Logo}></div>
        </div>
    );
}


export default MobileHome;
